import React from 'react'
const CTA = () => {
  return (
    <div className='cta'>
      <a href="#dogs" className='btn' >VIEW DOGS</a>
      <a href="#cats" className='btn btn-primary'> VIEW CATS</a>
    </div>
  )
}

export default CTA;
